import React from 'react';
import './service-card.css';

const ServiceCard = ({ item }) => {

  const {imgUrl, title, desc} = item


  return (
    <div className='services__item'>
      <div className="services__img">
        <img src={imgUrl} alt="" />
      </div>

      <h5>{ title }</h5>
      <p>{ desc }</p>

    </div>
  )
}

export default ServiceCard
